  color: {
    color: theme.palette.primary.font,
  },
  bckcolor: {
    backgroundColor: theme.palette.primary.main,
  },
}));

const Footer = () => {
  const classes = useStyle();

  return (
    <div id="footer" className={`${classes.bckcolor} ${classes.color} footer`}>
      <div className="leftFooter">
        {/* <h4>DOWNLOAD OUR APP</h4>
        <p>Download App for Android and IOS mobile phone</p> */}
        <a href="http://youtube.com/6packprogramemr" style={{margin:"2vmax"}}>Disclaimer</a>
        <a href="http://instagram.com/meabhisingh" style={{margin:"2vmax"}}>Privacy Policy</a>
        <a href="http://instagram.com/meabhisingh" style={{margin:"2vmax"}}>Terms & Conditions</a>
      </div>

      <div className="midFooter">
        <h1>BTisoft</h1>
        <p>High Quality is our first priority</p>

        <a href="Copyright-Notice.html">Copyrights 2021 &copy; BTIsoft</a>
      </div>

      <div className="rightFooter">
        <h4>Follow Us</h4>
        <a href="Copyright-Notice.html">upwork</a>
        <a href="http://youtube.com/6packprogramemr">freelancer</a>
        <a href="http://instagram.com/meabhisingh">Facebook</a>
      </div>
    </div>
  );
};

export default Footer;
